(86, 'Les Oiseaux', 1, 6, 7, 8, 'Statue en bronze, oeuvre d''Albert Avetisyan, placée en 1992 à proximité de l''angle des rues d''Erevan et de La Défense. L''oeuvre est un témoignage de reconnaissance pour l''aide humanitaire apportée par Issy-les-Moulineaux lors du séisme de 1988 en Arménie.', 'Rue d''Erevan', '92130', 'Issy-les-Moulineaux', NULL, 'http://www.flickr.com/photos/39218659@N05/6143694697/in/photostream/', NULL, 48.818874000000000, 2.260936000000000, 1, '2014-03-01 00:00:00', NULL),
(87, 'Oeuvre dédié au poète Matos', 1, 6, 7, 0, 'Oeuvre réalisée par le sculpteur croate Ivan Kozaric en l''honneur du poète croate Antun Gustav Matos.', 'jardin des milles roses de l''hôpital Corentin Celton', '92130', 'Issy-les-Moulineaux', NULL, 'http://www.flickr.com/photos/39218659@N05/12431432115/', NULL, 48.828862000000000, 2.277389000000000, 1, '2014-03-01 00:00:00', NULL),
(88, 'Signal monumental', 1, 6, 7, 9, 'Sculpture non figurative en laiton, oeuvre de Guy Lartigue placée en 1980 sur le « Plateau Égalité -Rodin ». L''artiste a conçu son oeuvre à partir d''un principe simple en apparence : inscrire des figures rondes dans un carré.', 'Plateau égalité-Rodin', '92130', 'Issy-les-Moulineaux', NULL, 'http://www.flickr.com/photos/39218659@N05/6143693769/in/photostream/', NULL, 48.817853000000000, 2.259742000000000, 1, '2014-03-01 00:00:00', NULL),
(89, 'Père Jerzy Popieluszko', 1, 6, 7, 8, 'Statue en bronze, oeuvre de Jacques Chauvenet, placée en 1992 dans le Parc de l''Abbé Derry. Issy-les-Moulineaux est la première ville de France à avoir érigé une statue au Père Popieluszko.', 'Parc de l''Abbé Derry', '92130', 'Issy-les-Moulineaux', NULL, 'http://www.flickr.com/photos/39218659@N05/6143710919/in/photostream/', NULL, 48.822438000000000, 2.279352000000000, 1, '2014-03-01 00:00:00', NULL),
(90, 'Tour Eiffel', 1, 6, 7, 9, 'Enseigne de boutique en fer peint, réalisée par un artisan ferronnier local et posée en 1892 sur la façade du 42 rue Ernest Renan.  Réplique de la Tour du Champ de Mars, elle agrémentait la façade d''un magasin ? dont le propriétaire, Henri Mayer, fut maire d''Issy-les-Moulineaux. Elle a été classée au titre des Monuments Historiques le 20 janvier 1988.', '42 Rue Ernest Renan', '92130', 'Issy-les-Moulineaux', NULL, 'http://www.flickr.com/photos/39218659@N05/6143691425/', NULL, 48.827408000000000, 2.279888000000000, 1, '2014-03-01 00:00:00', NULL),
(91, 'Bonaventure Leca', 1, 6, 7, 8, 'Buste en bronze placé à la fin des années 1970 dans le square Bonaventure Leca. Bonaventure Leca (1887 - 1973) a été maire d''Issy-les-Moulineaux de 1953 à 1973.', 'Square Bonneaventure Leca', '92130', 'Issy-les-Moulineaux', NULL, 'http://www.flickr.com/photos/39218659@N05/6144252368/in/photostream/', NULL, 48.825289000000000, 2.272823000000000, 1, '2014-03-01 00:00:00', NULL),
(92, 'Fontaine sculptée', 1, 6, 7, 10, 'Sculpture en acier inoxydable, oeuvre de Rodolfo Vega, placée en 1989 mail Raymond Menand. À l''origine, l''oeuvre avait été conçue pour surmonter une vasque d''eau.', 'Mail Raymond Menand', '92130', 'Issy-les-Moulineaux', NULL, 'http://www.flickr.com/photos/39218659@N05/6144242562/in/photostream/', NULL, 48.825069000000000, 2.271906000000000, 1, '2014-03-01 00:00:00', NULL),
(93, 'Fontaine', 1, 6, 7, 10, 'Édicule portant un bas-relief en cuivre (mascaron de lion) employé comme orifice d''arrivée d''eau, érigé en 1914 place de la fontaine. C''est un exemple typique de borne-fontaine implantée à un carrefour, où l''élément métallique a un rôle à la fois ornemental et fonctionnel.', 'Place de la fontanie', '92130', 'Issy-les-Moulineaux', NULL, 'http://www.flickr.com/photos/39218659@N05/6144243536/in/photostream/', NULL, 48.822802000000000, 2.265533000000000, 1, '2014-03-01 00:00:00', NULL),
(94, 'Fontaine', 1, 6, 7, 10, 'Construction en acier inoxydable et maçonnerie, oeuvre de Pierre Baqué placée en 1992 rue Prudent Jassedé. Elle a été érigée à l''emplacement de la plus ancienne fontaine du bourg.', 'Rue Prudent Jassedé', '92130', 'Issy-les-Moulineaux', NULL, 'http://www.flickr.com/photos/39218659@N05/6143710245/in/photostream/', NULL, 48.823260000000000, 2.275145000000000, 1, '2014-03-01 00:00:00', NULL),
(95, 'Soleil', 1, 6, 7, 10, 'Sculpture en bronze doré, oeuvre de Michel Rico placée en 1988 à l''avant de la façade de l''Hôtel de Ville donnant sur le square Bonaventure Leca.  L''oeuvre, également intitulée « Zénith », s''apparente à une  fontaine adossée.', 'square de l''hôtel de ville', '92130', 'Issy-les-Moulineaux', NULL, 'http://www.flickr.com/photos/39218659@N05/6144249770/in/photostream/', NULL, 48.824589000000000, 2.273419000000000, 1, '2014-03-01 00:00:00', NULL),
(96, 'Maréchal Leclerc', 1, 6, 7, 8, 'Buste en bronze, oeuvre de Maïrée Mannick, placé en 1989 dans le square Bonaventure Leca. Le Maréchal Leclerc a libéré Issy-les-Moulineaux le 24 août 1944.', 'Square Bonneaventure Leca', '92130', 'Issy-les-Moulineaux', NULL, 'http://www.flickr.com/photos/39218659@N05/6143697279/in/photostream/', NULL, 48.825306000000000, 2.273266000000000, 1, '2014-03-01 00:00:00', NULL),
(97, 'Missak Manouchian', 1, 6, 7, 8, 'Buste en bronze, oeuvre de Michel Adjar, placé en 2009 place Groupe Manouchian. Le monument est, à travers ce personnage, dédié au groupe de résistants qui s''était rassemblé autour de lui et dont l''un des membres habitait Issy-les-Moulineaux. ', 'place Groupe Manouchian', '92130', 'Issy-les-Moulineaux', NULL, 'http://www.flickr.com/photos/39218659@N05/6143713915/in/photostream/', NULL, 48.815451000000000, 2.265089000000000, 1, '2014-03-01 00:00:00', NULL),
(98, 'Le grain qui germe', 1, 6, 7, 9, 'Sculpture non figurative en inox soudé à l''argon, oeuvre de Jac Adam placée en 1978 rue des Acacias (École Claude Boujon). La symbolique, explicitée par le titre, renvoie à l''éducation des enfants.', '3 Rue des Acacias', '92130', 'Issy-les-Moulineaux', NULL, 'http://www.flickr.com/photos/39218659@N05/6144265528/in/photostream/', NULL, 48.824765000000000, 2.266746000000000, 1, '2014-03-01 00:00:00', NULL),
(99, 'Musique', 1, 6, 7, 9, 'Bas-relief en aluminium (revêtu d''une patine blanche), oeuvre de Michel Rico posée en 1989.', 'Mail Menand, Conservatoire Noedermeyer', '92130', 'Issy-les-Moulineaux', NULL, 'http://www.flickr.com/photos/39218659@N05/6143702413/in/photostream/', NULL, 48.825069000000000, 2.269838000000000, 1, '2014-03-01 00:00:00', NULL),
(100, 'Trophées', 1, 6, 7, 9, 'Bas-reliefs en bronze réalisés par une fonderie d''art et posés en 1902 sur le portail d''entrée de l''ancienne usine de la Société Française de Munitions. Inspirés des trophées militaires célébrant une victoire, ils témoignent du prestige dont jouit l''entreprise. En 1991 lorsqu''elle déménage, le  portail est transféré dans le Parc de la Résistance, à l''angle de la rue du Père Natter.', '« Portail Gévelot », Parc Sainte Lucie', '92130', 'Issy-les-Moulineaux', NULL, 'http://www.flickr.com/photos/39218659@N05/6143693209/in/photostream/', NULL, 48.819293000000000, 2.251318000000000, 1, '2014-03-01 00:00:00', NULL),
(101, 'We have lift off', 1, 6, 7, 9, 'Haut-relief (figure) en bronze, aluminium poli et résine polyester, oeuvre de Crispine Guest posée en 1992 sur la façade de l''immeuble 12 rue Guynemer. À travers le mythe de l''homme ailé, l''oeuvre évoque la conquête de l''air et les premiers aviateurs, thème en rapport avec la proximité de l''ancien terrain d''aviation.', '12 Rue Guynemer', '92130', 'Issy-les-Moulineaux', NULL, 'http://www.flickr.com/photos/39218659@N05/6143704113/in/photostream/', NULL, 48.831004000000000, 2.278636000000000, 1, '2014-03-01 00:00:00', NULL),
(102, 'Héros morts pour la libération', 1, 6, 7, 8, 'Stèle en pierre portant un bas-relief en bronze, oeuvre de Charlotte Engels, placée en 1992 dans le parc de la Résistance. Initialement (avant 1978), elle avait été installée place Jules Gévelot.', 'Parc Sainte-Lucie', '92130', 'Issy-les-Moulineaux', NULL, 'http://www.flickr.com/photos/39218659@N05/6143713085/in/photostream/', NULL, 48.819983000000000, 2.251698000000000, 1, '2014-03-01 00:00:00', NULL),
