(427, 'Musée de la Carte à Jouer et Galerie d''Histoire de la Ville', 1, 6, 67, 0, 'Le Musée Français de la Carte à Jouer (lauréat du Prix Européen des Musées de l?Année 1999) est unique en France, tout comme sa collection qui est présentée sur 1 500m2. Horaires : Du mercredi au vendredi de 11h à 17h. Samedi et dimanche de 14h à 18h. Groupes sur rendez-vous du mardi au dimanche. Ouvert en juillet du mercredi au dimanche de 13h à 18h. Fermeture en août.', '16 Rue Auguste Gervais', '92130', 'Issy-Les-Moulineaux', '01 41 23 83 60', 'http://www.issy.com/ma-ville/equipements-culturels/musee-francais-de-la-carte-a-jouer', 'musee@ville-issy.fr', 48.822603000000000, 2.273536000000000, 1, '2014-03-01 00:00:00', NULL),
(428, 'La Ludothèque', 1, 6, 20, 0, 'Espace de 400m2 avec des aires de jeux régulièrement réaménagées, près de 6 700 jeux (jeux vidéos, déguisements, jeux de construction, jeux de société) pour jouer sur place ou emprunter. Pour tous les âges (du bébé à l?adulte). Mardi et vendredi : 15h30-18h30 Mercredi et samedi : 10h-12h30 et 14h30-18h30 1er samedi de chaque mois à 20h30 : Soirée jeu.', '18 Rue De L''Abbe Derry', '92130', 'Issy-Les-Moulineaux', '01 41 23 81 50', 'http://www.issy.com/ma-ville/equipements-culturels', 'ludotheque@ville-issy.fr', 48.822369000000000, 2.279119000000000, 1, '2014-03-01 00:00:00', NULL),
